	import {
		toLogin
	} from '@/libs/login.js';
	import {
		mapGetters
	} from "vuex";
	import signCalendar from '../components/signCalendar/index.vue';
	import Cache from '@/utils/cache';
	import {
		signInfo
	} from '@/api/user.js';
	import {
		setFormId
	} from '@/api/api.js';
	let app = getApp();
	export default {
		data() {
			return {
				active: false,
				theme: app.globalData.theme,
				targetDate: parseInt(new Date().getFullYear()) + "-" + parseInt(new Date().getMonth() + 1), //本月
				sumCount: 0,
				signData: [],
				signCount: [],
				integral: 0,
				experience: 0,
				month: '',
				preMoth: ''
			}
		},
		watch: {
			month(newVal) {
				let pre = Number(this.month)
				if (pre < 10) {
					this.preMoth = '0' + pre
				}  else {
					this.preMoth = pre
				}
				// if (pre == 0) {
				// 	this.preMoth = '1' + 2
				// } else if (pre < 10) {
				// 	this.preMoth = '0' + pre
				// } else {
				// 	this.preMoth = pre
				// }
				let next = Number(this.month) + 1
				if (next > 12) {
					this.nextMoth = '0' + 1
				} else if (next < 10) {
					this.nextMoth = '0' + next
				} else {
					this.nextMoth = next
				}
			}
		},
		onLoad: function(options) {
			uni.showLoading({
				title: "加载中",
				mask: true,
			});
			let now = new Date()
			this.year = now.getFullYear()
			let month = now.getMonth() + 1
			let pre = Number(month)
			if (pre < 10) {
				this.month = '0' + pre
			}  else {
				this.month = pre
			}
			this.getSignInfo(this.year + '-' + this.month);
			//this.months = this.year + '-' + this.month;
		},
		components: {
			signCalendar
		},
		methods: {
			clickSign(day) {
				this.signData.push(day);
				this.sumCount++
			},
			/**
			 * 关闭签到提示
			 */
			close: function() {
				this.active = false;
			},
			/**
			 * 数字分割为数组
			 * @param int num 需要分割的数字
			 * @param int length 需要分割为n位数组
			 */
			PrefixInteger: function(num, length) {
				return (Array(length).join('0') + num).slice(-length).split('');
			},
			/**
			 * 获取签到页信息
			 */
			getSignInfo: function(month) {
				signInfo({
					month: month
				}).then(res => {
					uni.hideLoading();
					let data = res.data;
					this.signData = data.signDateList
					this.signCount = this.PrefixInteger(data.signDayNum, 4);
					this.integral = data.integral;
					this.experience = data.experience;
					Cache.set('signRule', data.signRule);
					if(data.isTip) this.active = true;
				}).catch(err => {
					uni.hideLoading();

				});
			},
			toInfo() {
				uni.navigateTo({
					url: `/pages/users/user_sgin_info/index`
				})
			}
		}

	}
</script>

